	ClientUIService.prototype.loadDetail = function(clientId, subordinateUid){
		var self = this;	 
		var deferred = self.$q.defer();
		if(commonService.hasValueNotEmpty(subordinateUid)){
			var dataUrl = commonService.getUrl(commonService.urlMap.CLIENT_EDIT_SUBORDINATE,[ self.name, clientId, subordinateUid]);
			
			self.ajax.get(dataUrl).success(function(result) {
				self.detail = result;
				deferred.resolve(result);
			});
		}else{
			clientCoreService.loadDetail.call(self, clientId)
			.then(function(detail){
				self.detail = detail;
				deferred.resolve(detail);
			});
		}
		
		return  deferred.promise;
	};
	
