	ClientUIService.prototype.loadProspectMetaList = function(){
		var self = this;
		var deferred = self.$q.defer();
		var moduleName = commonService.CONSTANTS.MODULE_NAME.PROSPECT;
		self.prepareList(moduleName, function(list){
			self.prospectMetaList = angular.copy(list);
			self.prospectList = self.buidProspectList(list);
			deferred.resolve(list);
		});
		return  deferred.promise;
	};
	
	ClientUIService.prototype.fillClientList = function(list) {
		var self = this;			
		self.listOfRecentClientGroupOf4 = self.buildDocumentGroupOf4(list);
	};
	
	
	ClientUIService.prototype.linkProspect = function(){
		var self = this;
		var deferred = self.$q.defer();
		var moduleName = commonService.CONSTANTS.MODULE_NAME.PROSPECT;
		
		clientCoreService.linkProspect.call(self, self.prospectUid).then(function(result) {
			//update prospect list
			for ( var i = 0; i < self.prospectList.length; i++) {
				if(self.prospectList[i].value == self.prospectUid){
					self.prospectList[i].clientNum = self.detail.uid;
					self.prospectList[i].text = self.getMetaFullName(result);
					//update cache
					self.prepareList(moduleName, function(data){
						for ( var j = 0; j < data.length; j++) {
							if(self.prospectUid == data[j].uid){
								data[j] = result;
								break;
							}
						};
						self.prospectMetaList = angular.copy(data);
						deferred.resolve(result);
					});

					self.prospectList = self.sortProspectMetaList(self.prospectList);
					
					break;
				}
			}
		});
		return  deferred.promise;
	};
	
	ClientUIService.prototype.unlinkProspect = function(){
		var self = this;
		var deferred = self.$q.defer();
		var moduleName = commonService.CONSTANTS.MODULE_NAME.PROSPECT;
		
		clientCoreService.unlinkProspect.call(self)
		.then(function(result) {
			//update prospect list
			for ( var i = 0; i < self.prospectList.length; i++) {
				if(self.prospectList[i].value == self.prospectUid){
					self.prospectList[i].clientNum = "";
					//update cache
					self.prepareList(moduleName, function(data){
						for ( var j = 0; j < data.length; j++) {
							if(self.prospectUid == data[j].uid){
								var p = self._findProperty(data[j], "clientNum");
								p.value = '';
								self.prospectUid = '';
								break;
							}
						};
						self.prospectMetaList = angular.copy(data);
						deferred.resolve(result);
					});
					self.prospectList = self.sortProspectMetaList(self.prospectList);
					break;
				}
			}
		});
		return  deferred.promise;
	};
	
	
	ClientUIService.prototype.buidProspectList = function(data){
		var self = this;
		var items = [];
		for ( var i = 0; i < data.length; i++) {
			var fullname = self.getMetaFullName(data[i]);
			var clientNum = self._findProperty(data[i], 'clientNum').value;
			var item = {value: data[i].uid, text: fullname, clientNum: clientNum};
			items.push(item);
		}
		
		items = self.sortProspectMetaList(items);
		
		return items;
	};
	
	ClientUIService.prototype.selectProspectUid = function(clientUid) {
		var self = this;
		self.prospectUid = '';
		for ( var i = 0; i < self.prospectList.length; i++) {
			if(self.prospectList[i].clientNum == clientUid){
				self.prospectUid = self.prospectList[i].value; 
				break;
			}
		}
	};
	
	ClientUIService.prototype.selectProspectMetadata = function(clientUid) {
		var self = this;
		self.prospectMetadata = null;
		for ( var i = 0; i < self.prospectMetaList.length; i++) {
			var clientNum = self._findProperty(self.prospectMetaList[i], 'clientNum').value;
			if(clientNum == clientUid){
				self.prospectMetadata = self.prospectMetaList[i]; 
				break;
			}
		}
	};
	
	
	ClientUIService.prototype.clientIsLinked = function() {
		var self = this;
		if(self.detail == null) return false;
		for ( var i = 0; i < self.prospectList.length; i++) {
			if(self.prospectList[i].clientNum == self.detail.uid){
				return true;
				break;
			}
		}
		return false;
	};


	ClientUIService.prototype.getProspectFullName = function(uid) {
		var self = this;
		for ( var i = 0; i < self.prospectList.length; i++) {
			if(self.prospectList[i].value == uid){
				return self.prospectList[i].text;
			}
		}
		return "";
	};
	
	ClientUIService.prototype.formatYN = function(value){
		var formatValue = "";
		
		if(value != null && value.length > 0){
			if(value == 'Y') {
				formatValue = 'Yes';
			}else{
				formatValue = 'No';
			}
		}
		
		return formatValue;
	};
	
	ClientUIService.prototype.formatPolicyStatus = function(policyStatus){
		var formatValue = policyStatus;
		
		if(policyStatus != null && policyStatus.length > 0){
			formatValue = appService.getI18NText('policy.status.enum.'+policyStatus);
		}
		
		return formatValue;
	};
	
